-- ----------------------------
-- Table structure for procurement
-- ----------------------------
DROP TABLE IF EXISTS `procurement`;
CREATE TABLE `procurement`  (
  `ProId` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '采购单编号',
  `CorpId` int(0) NOT NULL COMMENT '公司编号 公司ID',
  `ProDate` datetime(0) NOT NULL COMMENT '采购日期 部门名称',
  `ProType` int(0) NOT NULL COMMENT '采购类型 关联采购类型字典表',
  `GoodsName` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '货物名称',
  `Unit` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '单位',
  `Type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '型号',
  `Numbe` int(0) NOT NULL COMMENT '数量',
  `Price` decimal(7, 2) NOT NULL COMMENT '单价',
  `TotalAmount` decimal(7, 2) NOT NULL COMMENT '总金额',
  `ApplicantId` int(0) NOT NULL COMMENT '申请人 申请人ID',
  `ApplicationDeptId` int(0) NOT NULL COMMENT '申请部门 申请部门ID',
  `ProDesc` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '备注',
  `Reviewer` int(0) NOT NULL COMMENT '审核人',
  `ReviewerDesc` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '审核意见',
  `AcceptorId` int(0) NOT NULL COMMENT '验收人 验收人ID',
  `FileinfoId` int(0) NULL DEFAULT NULL COMMENT ' 关联附件表 合同附件',
  `Status` int(0) NOT NULL COMMENT '状态  关联采购字典表',
  `CreateDate` datetime(0) NOT NULL COMMENT '创建时间',
  `ModifyDate` datetime(0) NULL DEFAULT NULL COMMENT '编辑时间',
  PRIMARY KEY (`ProId`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

