-- ----------------------------
-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user`  (
  `UserId` int(0) NOT NULL AUTO_INCREMENT COMMENT '主键自增ID',
  `EmployeeId` int(0) NULL DEFAULT NULL COMMENT '用户信息ID 职员数据表',
  `UserName` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '登录名',
  `Password` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '密码',
  `Salt` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '密码盐',
  `Status` int(0) NOT NULL COMMENT '状态 0为注销 1为正常',
  `RoleId` int(0) NOT NULL COMMENT '权限ID 关联权限表',
  `CreateDate` datetime(0) NOT NULL COMMENT '创建时间',
  `ModifyDate` datetime(0) NULL DEFAULT NULL COMMENT '编辑时间',
  PRIMARY KEY (`UserId`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 14 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

