-- ----------------------------
-- Table structure for vehicleinfo
-- ----------------------------
DROP TABLE IF EXISTS `vehicleinfo`;
CREATE TABLE `vehicleinfo`  (
  `VehicleinfoID` int(0) NOT NULL AUTO_INCREMENT COMMENT '车辆ID 采购单号',
  `VehicleType` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '车辆型号 部门名称',
  `VehicleSeatsNumber` int(0) NOT NULL COMMENT '车辆载人数量',
  `VehicleAffiliationCompany` int(0) NOT NULL COMMENT '车辆隶属公司 关联公司ID',
  `VehicleaffiliationPersonal` int(0) NULL DEFAULT NULL COMMENT '车辆隶属个人  关联个人ID',
  `Status` int(0) NOT NULL COMMENT '状态  关联车辆状态表',
  `CreateDate` datetime(0) NOT NULL COMMENT '创建时间',
  `ModifyDate` datetime(0) NULL DEFAULT NULL COMMENT '编辑时间',
  PRIMARY KEY (`VehicleinfoID`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for vehicleorders
-- ----------------------------
DROP TABLE IF EXISTS `vehicleorders`;
CREATE TABLE `vehicleorders`  (
  `OrderID` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '订单ID',
  `VehicleID` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '部门名称 车辆id',
  `UserID` int(0) NOT NULL COMMENT '用户id 关联用户ID',
  `VehicleDriverID` int(0) NOT NULL COMMENT '车辆司机ID 关联司机ID',
  `BeganAddress` int(0) NULL DEFAULT NULL COMMENT '开始地址',
  `DestinationAddress` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '目的地地址',
  `EndAddress` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '结束地址',
  `Mileage` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '里程数',
  `MileageBeganUrl` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '开始里程数照片 开始里程数照片',
  `MileageEndUrl` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '结束里程数照片 结束里程数照片',
  `BeganDate` datetime(0) NULL DEFAULT NULL COMMENT '开始时间 预计开始时间',
  `EndDate` datetime(0) NULL DEFAULT NULL COMMENT '结束时间 预计结束时间',
  `Status` int(0) NOT NULL COMMENT '状态 关联车辆订单字典表',
  `OrderDesc` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '订单描述 描述',
  `CreateDate` datetime(0) NOT NULL COMMENT '创建时间',
  `ModifyDate` datetime(0) NULL DEFAULT NULL COMMENT '编辑时间  ',
  PRIMARY KEY (`OrderID`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for warehouse
-- ----------------------------
DROP TABLE IF EXISTS `warehouse`;
CREATE TABLE `warehouse`  (
  `WarehouseId` int(0) NOT NULL AUTO_INCREMENT COMMENT '编号ID 仓库ID',
  `CorpId` int(0) NOT NULL COMMENT '公司编号 公司ID',
  `GoodsName` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '货物名称',
  `Unit` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '单位',
  `Type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '型号',
  `TotalNumbe` int(0) NOT NULL COMMENT '数量',
  `Price` decimal(7, 2) NOT NULL COMMENT '单价',
  `TotalAmount` decimal(7, 2) NOT NULL COMMENT '总金额',
  `CreateDate` datetime(0) NOT NULL COMMENT '创建时间',
  `ModifyDate` datetime(0) NULL DEFAULT NULL COMMENT '编辑时间',
  PRIMARY KEY (`WarehouseId`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

